you and me.
Now when I think about us,
I realize that we...
we were never meant to be.
We were like two people 
from different planets,
different universes,
thrown into the same pond;
a pond to which 
neither of us belonged.
We were two lonely souls
who tried to be
a little less lonely
with each other.
Yet, loneliness always
finds a place to live
when there are 
alot of empty spaces
inside of you.
I wish that I could have
filled the void inside you
and you would have completed 
all my missing pieces.
I wish things would not
have been the way they were.
I wish so many things
but still, at the end of it,
I want you to be you
because I will always be me.
This is why we parted
and this is why
we will never be.
Yet, on certain nights,
my might often wanders off
and I think about you;
I think of all those moments
in which two lonely 
homeless souls
found a place to stay, 
even if just for a while.
.
.
